import React, { Component } from 'react';


import './App.css';

class IndivCardContainer extends Component {
  render() {
    return (
        <div className="card" style="width: 18rem;">
            <img className="card-img-top" src="https://images.unsplash.com/photo-1431576901776-e539bd916ba2?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=2551&q=80" alt="Card image cap"/>
                <div className="card-body">
                    <h5 className="card-title">Card title</h5>
                    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the
                        card's content.</p>
                    <a href="#" className="btn btn-primary">Go somewhere</a>
                </div>
        </div>
 );
  }
}

export default IndivCardContainer;
